import React, { Component } from "react";
import Grid from "@material-ui/core/Grid";
import ReactPlayer from "react-player";
import Card from "@material-ui/core/Card";
import CardMedia from "@material-ui/core/CardMedia";
import CardActionArea from "@material-ui/core/CardActionArea";
import CardContent from "@material-ui/core/CardContent";
import Typography from "@material-ui/core/Typography";
import { Route , withRouter} from 'react-router-dom';

class CardB extends Component {
    constructor(props){
        super(props);
        this.login=this.login.bind(this)
      }

      login(){
        this.props.history.push('/Project');
          }

  render() {
    return (
      <Grid item xs={12} sm={3} md={3}>
        <div className="section">
          <Card>
            <CardActionArea onClick={this.login}>
              <CardMedia
                className="card"
                image={require("./color1.png")}
                title="Inuuuuu"
              />
              <CardContent>
                <Typography gutterBottom variant="h5" component="h2">
                  Project 2
                </Typography>
                <Typography variant="body2" color="textSecondary" component="p">
                The Shiba Inu is a superb hunting dog, and the ancestors of the breed were the hardiest survivors of Japan's mountainous regions.
                </Typography>
              </CardContent>
            </CardActionArea>
          </Card>
        </div>
      </Grid>
    );
  }
}

export default CardB;
